import React from "react";
import { TwitterTimelineEmbed } from "react-twitter-embed";

const News = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col">   <TwitterTimelineEmbed
        sourceType="profile"
        screenName="saradiqsa"
        theme="light"
        noHeader="true"
        noBorders="true"
        noFooter="true"
        options={{ height: 420 }}
      ></TwitterTimelineEmbed>

        </div>
     
      </div>
    </div>
  );
};

export default News;
